import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { Sun, Moon, Menu, X } from 'lucide-react';
import Swal from 'sweetalert2';
import './tailwind.css'; // if using Tailwind

const Navbar = () => {
  const navigate = useNavigate();
  const [mobileMenuOpen, setMobileMenuOpen] = useState(false);
  const [darkMode, setDarkMode] = useState(() => {
    return localStorage.getItem('theme') === 'dark';
  });
  const [showSettings, setShowSettings] = useState(false);

  const toggleTheme = () => {
    const newTheme = !darkMode;
    setDarkMode(newTheme);
    document.documentElement.classList.toggle('dark', newTheme);
    localStorage.setItem('theme', newTheme ? 'dark' : 'light');
  };

  const handleLogout = () => {
    Swal.fire({
      title: 'Are you sure you want to logout?',
      showCancelButton: true,
      confirmButtonText: 'Yes',
      cancelButtonText: 'No',
      buttonsStyling: false,
      customClass: {
        confirmButton: 'bg-red-600 text-white px-4 py-2 rounded-md mx-2 hover:bg-red-700',
        cancelButton: 'bg-gray-300 text-black px-4 py-2 rounded-md mx-2 hover:bg-gray-400',
      },
    }).then((result) => {
      if (result.isConfirmed) {
        localStorage.removeItem('userToken');
        navigate('/');
      }
    });
  };

  return (
    <nav className="bg-white dark:bg-gray-900 shadow-md fixed top-0 left-0 w-full z-50">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-10">
        <div className="flex justify-between h-16 items-center">
          <div className="flex items-center space-x-6">
            <Link to="/" className="text-2xl font-bold text-indigo-600 dark:text-white">
              SmartAI
            </Link>
            <div className="hidden md:flex space-x-4 ml-6">
              <Link to="/" className="text-gray-700 dark:text-white hover:text-indigo-600">Home</Link>
              <Link to="/chat" className="text-gray-700 dark:text-white hover:text-indigo-600">Analyze</Link>
            </div>
          </div>

          {/* Right Side */}
          <div className="hidden md:flex items-center space-x-2">
            <Link to="/login" className="bg-indigo-100 dark:bg-indigo-600 text-indigo-700 dark:text-white px-3 py-1.5 text-sm rounded-full hover:bg-indigo-200 dark:hover:bg-indigo-700 transition-all">
              Log In
            </Link>
            <Link to="/signup" className="bg-indigo-100 dark:bg-indigo-600 text-indigo-700 dark:text-white px-3 py-1.5 text-sm rounded-full hover:bg-indigo-200 dark:hover:bg-indigo-700 transition-all">
              Sign Up
            </Link>

            {/* Settings */}
            <div
              className="relative"
              onMouseEnter={() => setShowSettings(true)}
              onMouseLeave={() => setShowSettings(false)}
            >
              <button className="ml-3 text-gray-700 dark:text-white hover:text-indigo-600">
                ⚙️
              </button>
              {showSettings && (
                <div className="absolute right-0 top-8 bg-white dark:bg-gray-800 border border-gray-200 dark:border-gray-600 rounded-md shadow-lg py-2 w-40 z-50">
                  <button
                    onClick={toggleTheme}
                    className="block w-full text-left px-4 py-2 text-sm text-gray-700 dark:text-white hover:bg-gray-100 dark:hover:bg-gray-700"
                  >
                    {darkMode ? 'Light Mode' : 'Dark Mode'}
                  </button>
                  <button
                    onClick={handleLogout}
                    className="block w-full text-left px-4 py-2 text-sm text-red-600 hover:bg-red-100 dark:hover:bg-red-700"
                  >
                    Log Out
                  </button>
                </div>
              )}
            </div>
          </div>

          {/* Hamburger (Mobile) */}
          <div className="md:hidden flex items-center">
            <button onClick={() => setMobileMenuOpen(!mobileMenuOpen)} className="text-gray-700 dark:text-white">
              {mobileMenuOpen ? <X size={24} /> : <Menu size={24} />}
            </button>
          </div>
        </div>
      </div>

      {/* Mobile Menu */}
      {mobileMenuOpen && (
        <div className="md:hidden bg-white dark:bg-gray-900 backdrop-blur-lg p-4 space-y-4 shadow-md">
          <Link to="/" onClick={() => setMobileMenuOpen(false)} className="block text-gray-700 dark:text-white hover:text-indigo-600">
            Home
          </Link>
          <Link to="/chat" onClick={() => setMobileMenuOpen(false)} className="block text-gray-700 dark:text-white hover:text-indigo-600">
            Analyze
          </Link>
          <Link to="/login" onClick={() => setMobileMenuOpen(false)} className="block text-gray-700 dark:text-white hover:text-indigo-600">
            Log In
          </Link>
          <Link to="/signup" onClick={() => setMobileMenuOpen(false)} className="block text-gray-700 dark:text-white hover:text-indigo-600">
            Sign Up
          </Link>
          <button
            onClick={() => {
              toggleTheme();
              setMobileMenuOpen(false);
            }}
            className="block text-left w-full text-gray-700 dark:text-white hover:text-indigo-600"
          >
            {darkMode ? 'Light Mode' : 'Dark Mode'}
          </button>
          <button
            onClick={() => {
              setMobileMenuOpen(false);
              handleLogout();
            }}
            className="block text-left w-full text-red-600 hover:text-red-800"
          >
            Log Out
          </button>
        </div>
      )}
    </nav>
  );
};

export default Navbar;
